import "./AccountSidebar.css";
const AccountSidebar = ({ sidebar }) => {
  return (
    <div className={`account sidebar ${sidebar ? "active" : ""}`}>
      <div className="sidebar_navigation">
        <p>Completed Orders</p>
        <p>In Progress</p>
        <p>In revision</p>
        <p>Profile</p>
        <p>Home</p>
        <p>Logout</p>
      </div>
    </div>
  );
};

export default AccountSidebar;
